INSERT INTO `tbl_announcement` (`id`, `title`, `content`, `audience`, `announcement_type`, `file_url`, `created_by`, `created_at`, `updated_at`, `isDeleted`) VALUES
(1, 'Upcoming Teacher Evaluation Deadline', 'Dear School Administrators,\r\n\r\nWe would like to remind all concerned parties that the deadline for submitting teacher evaluation forms is fast approaching. Kindly ensure that all evaluations are completed and submitted by January 18, 2025 to allow for timely processing.\r\n\r\nPlease communicate this to all relevant teaching staff and ensure that evaluations are done with careful consideration of their performance. If there are any issues or concerns, feel free to reach out to the evaluation department at evaluation@school.edu.\r\n\r\nThank you for your cooperation.', 'school_admin', 'reminder', NULL, 1, '2024-12-08 11:18:14', '2024-12-08 11:18:14', 0),
(2, 'Pre-Service Teacher Deployment and Evaluation Updates', 'Dear Faculty and Staff,\r\n\r\nWe are pleased to inform you about the upcoming pre-service teacher deployments, evaluations, and attendance schedules. All relevant parties are advised to take note of the following updates:\r\n\r\n1. Deployment Schedule: Pre-service teachers will be deployed to their respective schools on the specified dates. Please coordinate with the concerned department heads for detailed schedules.\r\n2. Evaluation Requirements: Evaluation of pre-service teachers will take place as per the academic timeline. All mentors, cooperating teachers, and advisors are expected to participate actively in the process.\r\n3. Attendance: Pre-service teachers are required to maintain regular attendance during their deployment period. Failure to comply will impact their placement status.\r\n\r\nKindly ensure that all necessary preparations are made to facilitate smooth operations. Should you have any questions or concerns, feel free to contact the administration.', 'all', 'general', NULL, 1, '2024-12-16 13:37:18', '2024-12-16 13:37:18', 0),
(3, 'Pre-Service Teacher Deployment and Evaluation Reminder', 'A gentle reminder to all pre-service teachers: Please be sure to complete your deployment procedures and attend your scheduled evaluation meetings on time. Your cooperating teacher will be evaluating your internship performance. Make sure to keep track of all deadlines.', 'pre-service teacher', 'reminder', NULL, 1, '2024-12-16 13:38:14', '2024-12-16 13:42:16', 0),
(4, 'Cooperating Teachers\' Role in Internship Evaluation', 'This is to inform all cooperating teachers that you will be responsible for evaluating the internship performance of pre-service teachers. Please ensure that evaluations are completed on time and submitted according to the provided guidelines.\r\n', 'cooperating teacher', 'important', NULL, 1, '2024-12-16 13:42:49', '2024-12-16 13:42:49', 0),
(5, 'Pre-Service Teacher Deployment and Evaluation Management', 'As part of the deployment and evaluation process for pre-service teachers, please ensure that all necessary procedures are followed. Be proactive in addressing any concerns related to internship performance and evaluations.', 'school_admin', 'reminder', NULL, 1, '2024-12-16 13:43:11', '2024-12-16 13:43:11', 0),
(6, 'Pre-Service Teacher Deployment, Evaluation, and Attendance Coordination', 'As we prepare for the deployment of pre-service teachers, we would like to highlight key areas that require your attention:\r\n\r\n1. Deployment Scheduling: Please coordinate with the respective departments to ensure that all pre-service teachers are deployed on schedule and have the necessary resources for their placements.\r\n2. Evaluation Coordination: Ensure that all pre-service teachers are evaluated according to the set timeline. Provide support to advisors and cooperating teachers to ensure the evaluation process runs smoothly.\r\n3. Attendance Monitoring: Monitor the attendance of pre-service teachers during their deployment and assist in addressing any issues that may arise.\r\n\r\nYour cooperation is essential for the success of the pre-service teacher program. Please do not hesitate to reach out should you need any further information or assistance.', 'school_admin', 'important', NULL, 1, '2024-12-16 13:44:22', '2024-12-16 13:44:22', 0),
(7, 'Journal Submission', 'Attention all Pre-Service Teachers:\r\nThis is a reminder to submit your journal entries reflecting your experiences and progress during your internship. Your journal is a key component of your final evaluation, so please ensure that it is completed and organized.', 'pre-service teacher', 'important', NULL, 1, '2024-12-16 13:47:10', '2024-12-16 13:48:07', 0),
(8, 'Student Portfolio Submission', 'Attention all Pre-Service Teachers:\r\nPlease submit your student portfolio showcasing your work and achievements throughout your placement. The portfolio should include relevant assignments, projects, and other significant contributions.', 'pre-service teacher', 'important', NULL, 1, '2024-12-16 13:48:46', '2024-12-16 13:48:46', 0);

